metadata.usage:
添加别名：alias {name}={command}
查看别名：alias {name}
别名列表：alias -p
删除别名：unalias {name}
清空别名：unalias -a

@我 + “五子棋”、“黑白棋”、“围棋”开始一局游戏;
再发送“落子 字母+数字”下棋，如“落子 A1”;
发送“结束下棋”结束当前棋局；发送“显示棋盘”显示当前棋局

触发方式：@机器人 [角色名][发送|说][文本内容]
※超级用户管理(若设置前缀，以下均加上前缀)
   @机器人 [禁用翻译 xxx]   禁用xxx翻译项
   @机器人 [启用翻译 xxx]   启用xxx翻译项
   @机器人 [查看翻译]         查看目前可用的翻译项
   @机器人 [查看禁用翻译]  查看已被禁用的翻译项
